import React from 'react';
import ReactDOM from 'react-dom';
import {
  Text,
  View,
} from 'react-native';
import './index.css';
import * as serviceWorker from "./serviceWorker";
import * as dataMgr from './dataMgr';
import ScrollableTabView, { ScrollableTabBar, } from 'react-native-scrollable-tab-view';

dataMgr.regNewTool("我的世界", ()=>{
    return(
        <text id = "d"> 我的世界 </text>
    );
})


dataMgr.regNewTool("我的世界1", ()=>{
    return(
        <text id = "c"> 我的世界1 </text>
    );
})

dataMgr.regNewTool("我的世界2", ()=>{
    return(
        <text id = "b"> 我的世界2 </text>
    );
})

dataMgr.regNewTool("我的世界3", ()=>{
    return(
        <text id = "a"> 我的世界3 </text>
    );}
)



class Show extends React.Component {
    constructor(props){
        super(props);
        this.state = {
          name:"input",
        }
    }

    render() {
        var info = dataMgr.ShowInfo((x)=>{
            this.setState({name:x})
        })
        console.log("dataMgr.ShowInfo")
        return (
            <div>
            <ScrollableTabView style={{marginTop: 20, }} initialPage={0} renderTabBar={() => <ScrollableTabBar />}>
            <Text tabLabel='Tab #1'>My</Text>
            <Text tabLabel='Tab #2 word word'>favorite</Text>
            <Text tabLabel='Tab #3 word word word'>project</Text>
            <Text tabLabel='Tab #4 word word word word'>favorite</Text>
            <Text tabLabel='Tab #5'>project</Text>
            </ScrollableTabView>
            {info}
            </div>
        );
    }
}

ReactDOM.render(<Show/>, document.getElementById('root'))

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
